import App from '../page objects/pages/App'
import SalonSignIn from '../page objects/pages/SalonSignIn'

describe('Login fucntionality', () => {
    it('Should not login with invalid credentials', () => {
        App.openApp()
        SalonSignIn.inputIsVisible()
        SalonSignIn.fillSalonId("LO27BE9A")
        SalonSignIn.submitSalonId()
        
        const message=SalonSignIn.error
        expect(message).toHaveText('Salon Id is incorrect!')
    });
    it('Error appears when to many characters are entered', () => {

        App.openApp()
        SalonSignIn.inputIsVisible()
        SalonSignIn.fillSalonId("LO27BE9Pastdd")
        //SalonSignIn.submitSalonId()

        const message=SalonSignIn.error
        expect(message).toHaveText('You reached the max character length')
        
    });
    it('Should login with valid credentuals', () => {
        App.openApp()
        SalonSignIn.inputIsVisible()
        SalonSignIn.fillSalonId("LO27BE9P")
        SalonSignIn.submitSalonId()

        expect(browser).toHaveUrl('https://d35c5nyi9oqz24.cloudfront.net/stylists')

    });

   
    
});

