    };

    clickAddNewStylistLink(){
        this.addNewStylistLink.waitForExist();
        this.addNewStylistLink.click();
    };
}
class StylistAdd extends Base{

    get nameInput(){
        return $('#input');
    };

    get error(){
        return $('.message');
    };
;

